import './App.css';
import Header from "./components/header"
import HomePage from "./components/home"
import FormationPage from "./components/formations"

const urlPage =window.location.href.split("/")[3] 
console.log(urlPage)
function App(page = "home") {
  return(
    <div className="App">

	    <Header/>
      <FormationPage/>

    </div>
  )
  // HOMEPAGE
  return (
    <div className="App">

	    <Header/>
      <HomePage/>

    </div>
  );
}

export default App;
